import React from 'react';

import classes from './BasketButton.module.css';

function BasketButton({ basket }) {


    return (
        <div className={classes.basketButton__wrapper}>
            <div className={classes.basketButton}>
                {/* <svg role="img" xmlns="http://www.w3.org/2000/svg" className={classes.basketButton__svg} viewBox="0 0 67 67"><path fill="none" stroke-width="2" stroke-miterlimit="10" d="M44 
                18h10v45H10V18h10z"></path><path fill="none" stroke-width="2" stroke-miterlimit="10" d="M22 24V11c0-5.523 4.477-10 10-10s10 4.477 10 10v13"></path></svg> */}
                <img src="../imgs/icons/basket.svg" alt="" />
            </div>
        </div>
    );
}

export default BasketButton;
